import { CREATE_PICTURE } from '../constants/types'

const initialState = {
    num:0
}

export default (state = initialState, action) => {

    switch (action.type) {
        case CREATE_PICTURE:{
            let i = state.num+1
            return{
                ...state,
                num:i
            }
        }
        default:
            return state
    }

}
